    const svgVariants = {
        ready: { opacity: 0},
        start: { opacity: 1,
            transition: { 
                opacity: { delay: 3, duration: 1, type:'tween', ease:'easeIn' },
                viewBox: { delay: 3.5, duration: 1, type:'tween', ease:'backOut' }

            }
        }
    }

