                </defs>

                <path d="M10.5426 0.801636H0.542664V2.8015H10.5426V0.801636Z" fill={props.color} stroke={props.color} stroke-width="0.945643" stroke-miterlimit="1.5" stroke-linecap="round" stroke-linejoin="round"/>
            </svg>
        </div>
    )
}
export default Rectangle;
